export const HOME_ROUTE = "/";
export const STAKE_ROUTE = "/staking";
export const MINT_ROUTE = "/mint";
export const V2_STAKE = "/v2";

export const HOME_LABEL = "Home";
export const STAKE_LABEL = "Stake";
export const MINT_LABEL = "Mint";
export const V2_STAKE_LABEL = "V2stake";

export const ROUTES = [
  {
    path: HOME_ROUTE,
    label: HOME_LABEL,
  },
  {
    path: STAKE_ROUTE,
    label: STAKE_LABEL,
  },
  {
    path: MINT_ROUTE,
    label: MINT_LABEL,
  },
  {
    path: V2_STAKE,
    label: V2_STAKE_LABEL,
  },
];
